// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";

/**
 * @title the implementation to clone on each pod creation
 * @author Eric Nordelo
 */
contract PodToken is ERC20, Pausable, AccessControl, Initializable {
    bytes32 public constant WITHDRAW_MANAGER_ROLE = keccak256("WITHDRAW_MANAGER_ROLE");
    uint256 private constant PRICE_PRECISION = 10000;

    string private _proxiedName;
    string private _proxiedSymbol;

    // solhint-disable-next-line
    constructor() ERC20("Privi Pod Token Implementation", "pPODT") {}

    /**
     * @notice ensures that the pod token contract begins paused and with the default admin
     */
    function initialize(string calldata _name, string calldata _symbol) external initializer {
        _proxiedName = _name;
        _proxiedSymbol = _symbol;

        _pause();
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function pause() public onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    function mint(address to, uint256 amount) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _mint(to, amount);
    }

    function burn(address to, uint256 amount) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _burn(to, amount);
    }

    function transferContractBalance(
        address to,
        uint256 amount,
        address tokenAddress
    ) external onlyRole(WITHDRAW_MANAGER_ROLE) {
        uint256 balance = ERC20(tokenAddress).balanceOf(address(this));
        require(balance >= amount, "Insuficient funds");

        require(ERC20(tokenAddress).transfer(to, amount), "Fail to transfer");
    }

    /**
     * @dev ensures that only minting is allowed when paused
     */
    function transfer(address recipient, uint256 amount) public override whenNotPaused returns (bool) {
        return super.transfer(recipient, amount);
    }

    /**
     * @dev ensures that only minting is allowed when paused
     */
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override whenNotPaused returns (bool) {
        return super.transferFrom(sender, recipient, amount);
    }

    /**
     * @notice allows the return of funds after a pod disposal
     */
    function returnPodTokens(
        address _investor,
        address _tokenAddress,
        uint256 _tokenPrice
    ) external onlyRole(WITHDRAW_MANAGER_ROLE) {
        uint256 balance = balanceOf(_investor);
        uint256 amount = (balance * _tokenPrice) / PRICE_PRECISION;
        _burn(_investor, balance);

        require(ERC20(_tokenAddress).transfer(_investor, amount), "Fail to transfer");
    }

    function name() public view virtual override returns (string memory) {
        return _proxiedName;
    }

    function symbol() public view virtual override returns (string memory) {
        return _proxiedSymbol;
    }
}
